Tää viikko jää core-muistoihin💫 Me ollaan naurettu, itketty, pohdittu isoja juttuja ja opittu niin paljon, ei vaan esiintymisestä ja brändistä, vaan siitä keitä me oikeesti ollaan ja mitä halutaan edustaa.

On ollut tosi ihana huomata, miten paljon voi kasvaa ja oppia kun ympärillä on turvallinen porukka ja tila olla auki. Ja miten paljon voimaa on siinä, kun uskaltaa olla rehellisesti oma itsensä.❤️

Oon tosi kiitollinen tästä kaikesta. Ihmisistä, fiiliksistä, Järvisydämestä ja tästä omasta pienestä missikuplasta.🥹

